import React from 'react';
import {BrowserRouter as Router , Switch, Route} from 'react-router-dom';
import Upload from './components/Upload'
import './App.css'


function App() {
  return (
    <Router>
        <div className="App">
          <Route path="/upload" component={Upload} />

        </div>  
    </Router>
  );
}

export default App;
